import React, { Component } from 'react';
// import logo from './logo.svg';
import './App.css';
import { PersonaService } from './service/PersonaService';
import {DataTable} from "primereact/datatable";
import {Column} from "primereact/column";
import {Panel} from "primereact/panel";

import "primereact/resources/themes/nova/theme.css" 
import "primereact/resources/primereact.min.css"
import "primeicons/primeicons.css"

export default class App extends Component{
  constructor(){
    super();
    this.state = {};
    this.PersonaService = new PersonaService();
  }

  componentDidMount(){
    this.PersonaService.getAll().then(data => this.setState({
      personas : data
    }))

    console.log(this.state);
  }

  render(){
    return (
      <Panel header="React CRUD JS" style={{width:'80%', marginTop:'20px', margin:'0 auto'}}>
        <DataTable value={this.state.personas}>
          <Column field="nombre" header="ID"></Column>
          <Column field="username" header="Usuario"></Column>
          <Column field="correoElectronico" header="Correo"></Column>
        </DataTable>
      </Panel>
    );
  }

}
